import React from "react";
import styled from "styled-components";

import AboutEcGrowth from "../molecules/AboutEcGrowth";
const ContentBlock = styled.div`
  width: 848px;
  height: 480px;
  margin-left: 22.16%;
  margin-right: 7%;
`;

function AboutEcContents() {
  return (
    <ContentBlock>
      <AboutEcGrowth />
    </ContentBlock>
  );
}

export default AboutEcContents;
